import React, { Component } from 'react'
import Items from './Items'

export class Item extends Component {
  render() {
    return (
        <main>
        {this.props.items.map(el => (
            <Items key={el.id} item={el}/>
        ))}
    </main>
    )
  }
}

export default Item
